webpackJsonp([57436418109601],{685:function(e,t){e.exports={data:{allMarkdownRemark:{edges:[{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/parry.md absPath of file >>> MarkdownRemark",html:"<p>The Parry skill improves your parry bonus (PB).  Effectiveness\ndepends on your warrior level.</p>",frontmatter:{title:"PARRY",syntax:"N/A (automatic effect)",group:"Warrior",level:0,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/weapontypes.md absPath of file >>> MarkdownRemark",html:'<p>The following weapon skills are available: slashing, concussion, spears,\npiercing, axes, and whips/flails.  It\'s not trivial to determine which weapon\nis better (though comparing can give you some idea), or which good weapon you\nwill find in your adventures. Slashing weapons are most common, so many people\nlearn how to use only slashing weapons. If you want to know how to use any type\nof weapons, consider learning "weapon mastery".</p>',frontmatter:{title:"WEAPON TYPES SLASHING CONCUSSION POLEARMS PIERCING SPEARS AXES WHIPS/FLAILS",syntax:"N/A (automatic effect)",group:"Warrior",level:0,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/twohanded.md absPath of file >>> MarkdownRemark",html:'<p>The Two-Handed skill helps with wielding weapons with both hands\nsuccessfully.  You can wield any weapon in one or two hands with the\ncommands "onehanded" and "twohanded" ("one and "two" being the shortcuts).\nSome weapons are worse onehanded, while some are worse twohanded.\nWhen wielding weapons twohanded, though, your effective skill is about\nthe average between your skill with the weapon\'s type and your skill\nin two-handed weapons.</p>',frontmatter:{title:"TWO-HANDED",syntax:null,group:"Warrior",level:1,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/weaponmastery.md absPath of file >>> MarkdownRemark",html:"<p>The Weapon Mastery skill gives you knowledge in all weapon types\nand the two-handed skill.  It is quite hard to learn, but easier than\nall of the skill separately.</p>",frontmatter:{title:"WEAPON MASTERY",syntax:"N/A (automatic effect)",group:"Warrior",level:1,offensive:"Yes"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/kick.md absPath of file >>> MarkdownRemark",html:"<p>The Kick skill makes an attempt to kick chosen target, causing a small\namount of damage.  The success of a kick depends on how well you are learned\nin the skill, and your warrior level.  There is also a small delay after\nkicking, along with the normal waiting time before.</p>",frontmatter:{title:"KICK",syntax:"kick <target>",group:"Warrior",level:2,offensive:"Yes"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/rescue.md absPath of file >>> MarkdownRemark",html:"<p>The Rescue skill allows one to rescue a target from a battle,\nreplacing the target in combat with you.  It only works against\none enemy, though, and it does not work at all for mental combat.</p>",frontmatter:{title:"RESCUE",syntax:"rescue <target>",group:"Warrior",level:3,offensive:"Yes"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/bash.md absPath of file >>> MarkdownRemark",html:"<p>The Bash skill allows one to bash mobs/players, or doors.</p>\n<p>To bash a person is an attempt to knock them over.  If you succeed\nyou will inflict minor damage, and cause the victim to topple.  The\nvictim will be unable to do anything for a short while.  The success\nof a bash depends on how well you are learned in the skill, your\nwarrior level, your offensive abilities, your weight, and whether you\nwear a shield or not.</p>\n<p>To bash a door is an attempt to bash the door in, breaking it open.\nYour strength and bashing skill are depended on for success.  Dwarves, Beornings, Olog-Hais,\nand Uruk-Hais have a slight bonus, and Elves and Hobbits cannot\nbash doors at all.  Not all doors can be bashed, for example, gates\nand magical doors.</p>",frontmatter:{title:"BASH",syntax:"bash <target/door>",group:"Warrior",level:5,offensive:"Yes"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/berserk.md absPath of file >>> MarkdownRemark",html:"<p>Berserk helps warriors control themselves while using berserk\ntactics.  This skill is necessary for effective use of berserk tactics.\nIt also helps warriors to calm down when they need to.</p>",frontmatter:{title:"BERSERK",syntax:"N/A (automatic effect)",group:"Warrior",level:7,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/findweakness.md absPath of file >>> MarkdownRemark",html:"<p>The Find Weakness skill allows you to find weaknesses in your\nenemy's defence.  If successful, it gives you additional damage\nwith your hits.  The skill heavily depends on how good your warrior\ntraining is.</p>",frontmatter:{title:"FIND WEAKNESS",syntax:"N/A (automatic effect)",group:"Warrior",level:20,offensive:"Yes"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/ride.md absPath of file >>> MarkdownRemark",html:"<p>Riding will mount one upon chosen target, if the target is a mount\nmob.  Without the use of this skill, riding will not benefit one much,\nand might even be worse than walking normally.  Rangers who know how\nto deal with animals will also find riding easier.\nTyping just 'ride' while a mount is following you will have you ride\nthe mount.</p>\n<p> ride                      - rides the first following mount.</p>\n<p> ride target             - rides target, if target is a mount mob.</p>\n<p> dismount                  - dismounts, mount starts following you.</p>\n<p>lose target             - \"loses\" target following mob/person.</p>",frontmatter:{title:"RIDE",syntax:"ride <target> / ride",group:"Ranger",level:0,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/search.md absPath of file >>> MarkdownRemark",html:"<p>Searching in a room without a chosen target will search for\nhidden people in the room, uncovering friends and enemies alike.\nWith a chosen direction, it will search in the direction for a\nhidden exit.  The success of a search depends primarily upon the\namount of experience the searcher has with the search skill;\nhowever, it is also heavily based on the searcher's awareness and\nintelligence.  </p>\n<p>If you fail to uncover a hidden character in your room after\nsearching it, that character's hide will be less effective for\nevading further detection.</p>\n<p>Examples:</p>\n<p>search north</p>\n<p>searches for a hidden exit to the north.</p>\n<p>search</p>\n<p>searches for hidden characters in the room.</p>",frontmatter:{title:"SEARCH",syntax:"search / search <direction>",group:"Ranger",level:0,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/track.md absPath of file >>> MarkdownRemark",html:"<p>Tracking will have you attempt to find tracks of things that have passed\nthrough the room you are in.  The command 'track', without a target, will\nattempt to show all the tracks found in the room.  Tracking a chosen target\nwill attempt to show any tracks of the target that are in the room.</p>\n<p>Tracks do disappear over time.  Tracks can be more or less visible depending\non the weather and the terrain.</p>\n<p>Also, one can use the command 'hunt'.  Based on one's tracking ability, they\ncan attempt to see the tracks in a room upon 'look'ing in and entering rooms.\nThe chance to successfully see tracks while hunting is less than while\ntracking normally, and one will only find fresh tracks.  Also, there is a\nsmall delay associated with hunting, which happens after looking/entering\na room.</p>\n<p> track                  - searches for tracks in the room.</p>\n<p> track target         - searches for tracks of target in the room.</p>\n<p> hunt                   - Toggles hunting on and off.</p>",frontmatter:{title:"TRACK",syntax:"track / track <target> / hunt",group:"Ranger",level:0,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/archery.md absPath of file >>> MarkdownRemark",html:"<p>The Archery skill allows you to utilize a bow and arrow. The chance\nof having a successful shot is determined by the attacker's archery skill,\naccuracy skill, and ranger level. The attack must also be wielding a bow\nor crossbow, have a quiver on his/her back, arrows inside the quiver, and\nwield the bow/crossbow with both hands. </p>",frontmatter:{title:"ARCHERY",syntax:"shoot <target>",group:"Ranger",level:1,offensive:"Yes"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/awareness.md absPath of file >>> MarkdownRemark",html:"<p>The awareness skill heightens one's senses, helping them to be\naware of hiding life and notice oncoming ambushes.  A ranger's\nawareness is dependent on many factors, including: proficiency\nas a ranger, proficiency in the awareness skill, specialization,\nintelligence, and race.</p>",frontmatter:{title:"AWARENESS",syntax:"N/A (automatic effect)",group:"Ranger",level:1,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/calm.md absPath of file >>> MarkdownRemark",html:"<p>The Calm skill allows one to calm animals, stopping them from\naggressive action for a period of time, and making them easier\nto tame.</p>",frontmatter:{title:"CALM",syntax:"calm <target>",group:"Ranger",level:1,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/dodge.md absPath of file >>> MarkdownRemark",html:"<p>The Dodge skill improves your dodging bonus (DB).  Effectiveness\ndepends on your ranger level.</p>",frontmatter:{title:"DODGE",syntax:"N/A (automatic effect)",group:"Ranger",level:1,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/picklock.md absPath of file >>> MarkdownRemark",html:"<p>The Pick Lock skill allows one to try and pick a lock, unlocking whatever\nwas chosen as a target if successful.  Not all locks can be picked.</p>\n<p>pick <door>          - attempts to pick the lock of a locked target door.</p>\n<p>pick <container>     - attempts to pick the lock of a locked target container.</p>",frontmatter:{title:"PICK LOCK",syntax:"pick <door/container>",group:"Ranger",level:1,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/swim.md absPath of file >>> MarkdownRemark",html:'<p>Swimming allows one to enter water-filled rooms without the aid of a boat.\nTo enable the skill, one must "set swim on".</p>',frontmatter:{title:"SWIM",syntax:"N/A (automatic effect)",group:"Ranger",level:1,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/hide.md absPath of file >>> MarkdownRemark",html:"<p>The hide skill allows one to hide from others.  While hidden,\nthere is a chance people will not notice you, based on your\nhide skill, ranger level, whether you entered the room with a\nsuccessful sneak, stealth, and terrain, versus the other player\nor mob's awareness.  It is skill versus skill; anyone may\nattempt to hide, as well as anyone can possibly see a hidden\nplayer.  While hidden, most actions will cause you to reveal\nyourself.</p>\n<p>You may also choose to specify the WELL option when hiding.\nBy using HIDE WELL, you will take a substantially greater care\nin choosing your hiding spot, resulting in a long wait and\nenhanced concealment.</p>",frontmatter:{title:"HIDE",syntax:"hide / hide well",group:"Ranger",level:2,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/stealth.md absPath of file >>> MarkdownRemark",html:"<p>The stealth skill increases one's ability to perform skills\nthat require an element of surprise or concealment, such as:\nhiding, sneaking, riposting and ambushing.  To become a master\nof stealth, however, requires a rather hefty sacrifice of\nphysical constitution.</p>",frontmatter:{title:"STEALTH",syntax:"N/A (automatic effect)",group:"Ranger",level:2,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/tame.md absPath of file >>> MarkdownRemark",html:"<p>The Tame skill allows one to tame most animals.  A tamed animal\nwill follow you, and obey your commands.  The animals you can tame\nare determined by your tame skill, ranger level, whether the animal\nhas been calmed, and whether you have any animals tamed already.\nNote that because of the way this skill is coded, some things\nwhich are actually animals are untameable as of now.</p>",frontmatter:{title:"TAME",syntax:"tame <target>",group:"Ranger",level:2,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/fastattack.md absPath of file >>> MarkdownRemark",html:"<p>The Fast Attack skill increases one's attack speed under certain\nconditions.  The increase in speed depends on the percent learned in\nthe skill and the weight of the wielded weapon.  Effect while wielding\na heavy weapon will be low to none, while it could be quite a bit with\na light weight weapon.</p>",frontmatter:{title:"FAST ATTACK",syntax:"N/A (automatic effect)",group:"Ranger",level:3,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/gather.md absPath of file >>> MarkdownRemark",html:'<p>The Gather Herbs skill allows a ranger to find useful materials on the land\n(not only herbs). "Gather food" lets one attempt to find some edible roots and\nberries, and "gather light" finds something that burns well. "Gather energy"\nand "gather healing" puts you in a mode of gathering useful herbs that help\nyou replenish moves or hit points. "Gather bow" will find some twigs and\nbranches to fashion into a crude bow. "Gather arrow" will search the room for\nitems that you can make into a crude arrow. Fish" command is a version of "gather\nfood", that allows one to fish, while holding a fishing pole and riding a\nboat, if in a water room. The outcome of the gathering is strongly affected by\nthe terrain in which one is gathering.</p>\n<p>gather food     - attempts to gather food from current location.\nfish            - attempts to fish from current location.</p>',frontmatter:{title:"GATHER",syntax:"gather [food/energy/healing/light/bow/arrow] OR fish",group:"Ranger",level:5,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/sneak.md absPath of file >>> MarkdownRemark",html:"<p>Sneaking allows one to move between rooms without anyone taking\nnotice to the sneaker's entrance or exit.  When someone enters\na room without being noticed, they are effectively hidden - but\nvery poorly.  However, since the sneaker did not forfeit his\nelement of surprise by entering haphazardly, he receives quite\na formidable bonus to any stealth* related abilities that he may\nperform while still unnoticed.  Since the moving character is\npaying far more attention to his movements than in casual motion,\nthere is a small delay associated with any movement while sneak\nis enabled. </p>\n<p>A successful discreet passage from one room to the next depends\non the sneaker's knowledge of the sneak skill and their stealth.</p>\n<p>To toggle sneak on or off, simply type 'sneak'</p>",frontmatter:{title:"SNEAK",syntax:"sneak",group:"Ranger",level:5,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/ambush.md absPath of file >>> MarkdownRemark",html:"<p>Ambush is the favored attack of rangers; and it can be used with\nany weapon type.  The chance of performing a successful ambush is\ndetermined by the attacker's ambush skill, stealth, encumbrance\nand ranger level.</p>\n<p>A successful ambush removes a percentage of target's health based\non the factors stated above for percentage chance; additionally,\nthe damage depends upon the damage of the weapon the ranger is\nwielding and the encumbrance of the victim of the ambush.  It\nshould be noted that although heavy weapons increase the power of\nan ambush, they increase the challenge of landing an ambush\nconsiderably.  In addition to damaging the victim, the surprise\nand force of the ambush generally leaves the victim rather\nconfused, making it more difficult for him to parry.</p>\n<p>ambush wolf</p>\n<p>The trap ability allows rangers to prepare an ambush for a target\nnot yet present.  When the target enters the room where a ranger\nhas laid a trap, the ranger will instantly spring his trap, causing\nthe victim a good deal of damage.  Additionally, due to the nature\nof surprising a victim with such force and pain, the victim of a\nsuccessful trap will become stunned for a short period of time,\nwhile it tries to make sense of what is happening around it.</p>\n<p>You may choose to trap N.target; if you choose to do this, then\nyou will spring your trap when the Nth number of that target has\nentered the trapped room.</p>\n<p>trap warg\ntrap 2.orc</p>",frontmatter:{title:"AMBUSH",syntax:"ambush <target> OR trap <target>",group:"Ranger",level:6,offensive:"Yes"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/travelling.md absPath of file >>> MarkdownRemark",html:"<p>Experts in travelling are told to be able to run days and nights with no\nrest and travel great distances in amazingly little amount of times.</p>",frontmatter:{title:"TRAVELLING",syntax:"N/A (automatic effect)",group:"Ranger",level:6,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/animals.md absPath of file >>> MarkdownRemark",html:"<p>The Animals skill is one's ability to communicate with animals.\nThe skill increases a person's effectiveness with the tame and calm\nskills, as well as with ride.</p>",frontmatter:{title:"ANIMALS",syntax:"N/A (automatic effect)",group:"Ranger",level:10,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/accuracy.md absPath of file >>> MarkdownRemark",html:"<p>The Accuracy skill allows you to shoot your bow/crossbow with better\naccuracy and find weaknesses in your enemy's armour. If successful, it\nwill allow an arrow to bypass your enemy's armour absorption.</p>",frontmatter:{title:"ACCURACY",syntax:"N/A (automatic effect)",group:"Ranger",level:15,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/curse.md absPath of file >>> MarkdownRemark",html:'<p>Casting "Curse" will damage the statistics of chosen <target>.  This\nis mainly of use in mental combat.  The power\'s opposite is revive.</p>',frontmatter:{title:"CURSE",syntax:"cast 'curse' <target>",group:"Mystic",level:1,offensive:"Yes"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/detecthidden.md absPath of file >>> MarkdownRemark",html:'<p>Casting "Detect Hidden" increases one\'s ability to see hidden life forms\naround them.  This affect does not guarantee success in finding hidden life,\nbut does help.</p>',frontmatter:{title:"DETECT HIDDEN",syntax:"cast 'detect hidden'",group:"Mystic",level:1,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/detectmagic.md absPath of file >>> MarkdownRemark",html:'<p>Casting "Detect Magic" endows one with the ability to see a magical aura\nsurrounding items of magical nature, as well as the ability to see what magic\nspells or mystical powers are affecting a player or mob.</p>',frontmatter:{title:"DETECT MAGIC",syntax:"cast 'detect magic'",group:"Mystic",level:1,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/revive.md absPath of file >>> MarkdownRemark",html:'<p>Casting "Revive" will replenish damaged statistics of chosen <target>.\nThis is mainly of use after mental combat.  The power\'s opposite is curse.</p>',frontmatter:{title:"REVIVE",syntax:"cast 'revive' <target>",group:"Mystic",level:1,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/evasion.md absPath of file >>> MarkdownRemark",html:"<p>Casting \"Evasion\" improves the caster's ability to dodge physical\nattacks from creatures with low perception.  Note that it's effect does\nnot show up in the 'score' command.</p>",frontmatter:{title:"EVASION",syntax:"cast 'evasion'",group:"Mystic",level:2,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/hallucinate.md absPath of file >>> MarkdownRemark",html:'<p>Casting "hallucinate" on an opponent will cloud their vision and create the\nillusion of blurred images in their head. The number of "images" depends heavily\non how powerful a mystic the caster is, and how well-versed with the art of the\nillusion they are. When an affected opponent tries to hit someone (the caster or\nanyone else), there is a chance that they will hit an "image" and realize that\nthey\'ve just hit nothing. This chance decreases as they find out who\'s real and\nwho isn\'t. Once the opponent lands a hit on someone, they are no longer affected by\nthe power.</p>',frontmatter:{title:"HALLUCINATE",syntax:"cast 'hallucinate' <target>",group:"Mystic",level:3,offensive:"Yes"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/mindblock.md absPath of file >>> MarkdownRemark",html:"<p>Mind block will give the caster some protection against mental attacks\nwhich affect their mental stats.  </p>\n<p>That's all it does for now, but it may make it more difficult to attack other\npeople's mental stats too in time.</p>\n<p>This spell is not available to good races.</p>",frontmatter:{title:"MIND BLOCK",syntax:"cast 'mind block'",group:"Mystic",level:3,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/resistpoison.md absPath of file >>> MarkdownRemark",html:'<p>Casting "Resist Poison" when poisoned will enable your body to fight the\npoison better, enabling you to overcome its effects faster.</p>',frontmatter:{title:"RESIST POISON",syntax:"cast 'resist poison' <target>",group:"Mystic",level:3,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/curingsaturation.md absPath of file >>> MarkdownRemark",html:'<p>Casting "Curing Saturation" increases the chosen target\'s healing rate,\nat the cost of movement points.</p>',frontmatter:{title:"CURING SATURATION",syntax:"cast 'curing saturation' <target>",group:"Mystic",level:4,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/haze.md absPath of file >>> MarkdownRemark",html:'<p>Casting "Haze" will cover eyes of a target with a transparent\npsychic veil. The target will have difficulties finding the right way\nand stumble in fight.  The effect is not drastic, but fairly annoying.</p>',frontmatter:{title:"HAZE",syntax:"cast 'haze' <target>",group:"Mystic",level:5,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/insight.md absPath of file >>> MarkdownRemark",html:'<p>Casting "Insight" will increase the perception of chosen target, bringing\none closer to the wraith-world.</p>',frontmatter:{title:"INSIGHT",syntax:"cast 'insight' <target>",group:"Mystic",level:6,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/prag.md absPath of file >>> MarkdownRemark",html:'<p>Casting "Pragmatism" will decrease the perception of chose target.</p>',frontmatter:{title:"PRAGMATISM",syntax:"cast 'pragmatism' <target>",group:"Mystic",level:6,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/restlessness.md absPath of file >>> MarkdownRemark",html:'<p>Casting "Reslessness" increases the chosen target\'s movement regeneration,\nat the cost of hit points.</p>',frontmatter:{title:"RESTLESSNESS",syntax:null,group:"Mystic",level:6,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/resistmagic.md absPath of file >>> MarkdownRemark",html:"<p>Casting \"Resist Magic\" will increase the caster's endurance against\nenemies' magic.</p>",frontmatter:{title:"RESIST MAGIC",syntax:"cast 'resist magic'",group:"Mystic",level:8,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/slowdigestion.md absPath of file >>> MarkdownRemark",html:'<p>Casting "Slow Digestion" will slow down the chosen target\'s rate of\ndigestion, thus allowing him to wait longer between meals.</p>',frontmatter:{title:"SLOW DIGESTION",syntax:"cast 'slow digestion' <target>",group:"Mystic",level:11,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/vitality.md absPath of file >>> MarkdownRemark",html:'<p>Casting "Vitality" will significantly increase the specified target\'s\nmovement point regeneration.</p>',frontmatter:{title:"VITALITY",syntax:"cast 'vitality' <target>",group:"Mystic",level:11,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/fear.md absPath of file >>> MarkdownRemark",html:'<p>Casting "Fear" will scare the chosen target, causing them to flee\nchaotically until they save vs. the effect.</p>',frontmatter:{title:"FEAR",syntax:"cast 'fear' <target>",group:"Mystic",level:12,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/magicmissile.md absPath of file >>> MarkdownRemark",html:'<p>The simplest offensive spell, "Magic Missile" is just that: a magical\nmissile casted at a target.  It does a small amount of damage, costs\na low amount of mana to cast, and can be cast very quickly.</p>\n<p>Syntax Note: target is not needed if caster is fighting the target. </p>',frontmatter:{title:"MAGIC MISSILE",syntax:"cast 'magic missile' <target>",group:"Mage",level:0,offensive:"Yes"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/createlight.md absPath of file >>> MarkdownRemark",html:'<p>Casting "Create Light" will create a brilliant orb of light into your\ninventory.  This orb will provide light for approximately 20 hours (game-\ntime.)</p>',frontmatter:{title:"CREATE LIGHT",syntax:"cast 'create light'",group:"Mage",level:1,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/locateliving.md absPath of file >>> MarkdownRemark",html:'<p>Casting "Locate Living" will tell the caster the approximate direction\nand distance of N closest living things, where N is about 2 + level/5.\nThis will only work for a distance up to about 2 + level/10 rooms.</p>',frontmatter:{title:"LOCATE LIVING",syntax:"cast 'locate living'",group:"Mage",level:2,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/shield.md absPath of file >>> MarkdownRemark",html:"<p>Casting \"Shield\" surrounds the caster with a protective shield.  It is\ninvisible, but will absorb some physical or magical damage at the cost of the\ncaster's mana. The effectiveness of the spell depends on the caster's mage\nlevel. The caster must be aware of the attack - so shield is no protection\nagainst ambush or if the victim is asleep.</p>",frontmatter:{title:"SHIELD",syntax:"cast 'shield'",group:"Mage",level:2,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/cureself.md absPath of file >>> MarkdownRemark",html:'<p>Casting "Cure Self" will restore a small amount of hit points to the caster.</p>',frontmatter:{title:"CURE SELF",syntax:"cast 'cure self'",group:"Mage",level:3,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/detectevil.md absPath of file >>> MarkdownRemark",html:'<p>Casting "Detect Evil" will give the caster warning if the forces of evil\ncharacters are significantly higher than those of "good" in the area.</p>',frontmatter:{title:"DETECT EVIL",syntax:"cast 'detect evil'",group:"Mage",level:3,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/chillray.md absPath of file >>> MarkdownRemark",html:"<p>Casting \"Chill Ray\" fires a cold ray at a target, causing a small amount\nof damage, but more than a Magic Missile.  If the target fails it's saving\nthrow, it will delay the target's next attack in addition to inflicting the\ndamage.</p>\n<p>Syntax Note: target is not needed if caster is fighting the target.</p>",frontmatter:{title:"CHILL RAY",syntax:"cast 'chill ray' <target>",group:"Mage",level:4,offensive:"Yes"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/blink.md absPath of file >>> MarkdownRemark",html:'<p>Casting "Blink" teleports the caster of the spell to a random room\nnearby, usually one to three rooms away.  It is even possible to blink\nthrough some doors.</p>',frontmatter:{title:"BLINK",syntax:"cast 'blink'",group:"Mage",level:5,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/reveallife.md absPath of file >>> MarkdownRemark",html:'<p>Casting "reveal life" will create a quick surge of light which has a\na chance of revealing anyone hidden in the room; if reveal life fails\nto bring a hidden target to sight, there in-lies a chance that it will\nmake subsequent castings more likely to succeed. It does not, however,\nprevent people from hiding after the spell is cast.</p>',frontmatter:{title:"REVEAL LIFE",syntax:"cast 'reveal life'",group:"Mage",level:5,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/flash.md absPath of file >>> MarkdownRemark",html:'<p>Casting "Flash" produces a bright flash of light.  It will delay the\nnext attack of everyone in the room, and will disengage from combat all\nwho fail their saving throw. When flash is cast by powerful Wizards, it\nhas been known to have an adverse affect on the servants of the shadow.</p>',frontmatter:{title:"FLASH",syntax:"cast 'flash'",group:"Mage",level:6,offensive:"No"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/lightningbolt.md absPath of file >>> MarkdownRemark",html:'<p>Casting "Lightning Bolt" will fire a bolt of lightning at the chosen\ntarget, damaging him.  It is quite potent outside, but it\'s effectiveness\nis lowered inside.</p>\n<p>Syntax Note: target is not needed if caster is fighting the target. </p>',frontmatter:{title:"LIGHTNING BOLT",syntax:"cast 'lightning bolt' <target>",group:"Mage",level:7,offensive:"Yes"}}},{node:{id:"C:/Users/slyon/Documents/GitHub/rots-site/src/pages/docs/classes/warrior/darkbolt.md absPath of file >>> MarkdownRemark",html:'<p>Casting "Dark Bolt" will fire a bolt of darkness at a chosen target.\nThis spell is available to evil only.  If cast in sunlight, it\'s\neffectiveness is lowered.</p>\n<p>Syntax Note: target is not needed if caster is fighting the target.</p>',frontmatter:{title:"DARK BOLT",syntax:"cast 'dark bolt' <target>",group:"Mage",level:9,offensive:"Yes"}}}]}},pathContext:{}}}});
